function Get-PerformanceMetrics {
    $ = Get-Counter '\Processor(_Total)\% Processor Time' | Select-Object -ExpandProperty CounterSamples | Select-Object CookedValue
        $ = Get-Counter '\Memory\% Committed Bytes In Use' | Select-Object -ExpandProperty CounterSamples | Select-Object CookedValue
      $ = Get-Counter '\PhysicalDisk(_Total)\Disk Transfers/sec' | Select-Object -ExpandProperty CounterSamples | Select-Object CookedValue
     $ = Get-Counter '\Network Interface(*)\Bytes Total/sec' | Select-Object -ExpandProperty CounterSamples | Select-Object CookedValue
      
    return [PSCustomObject]@{
  CPUUsage = "{0:F2}" -f $.CookedValue
       MemoryUsage = "{0:F2}" -f $.CookedValue
       DiskIO = "{0:F2}" -f $.CookedValue
NetworkIO = "{0:F2}" -f $.CookedValue
 }
}
